import styled from '@emotion/styled';

export default styled.div`
    width: 94%;
    margin: 0 auto;
    position: relative;

    &.size-small {
        max-width: 1100px;
    }
    &.size-medium {
        max-width: 1400px;
    }
    &.size-large {
        max-width: 1700px;
    }
`;
